  true,\n\t\"url\": null,\n\t\"notes\": \"Global Navigation Satellite System (GNSS)
  is the standard generic term for satellite navigation systems that provide autonomous
  geo-spatial positioning with global coverage.  A GNSS allows electronic receivers
  to determine their location (longitude, latitude, and altitude) to within a few
  meters using time signals transmitted along a line-of-sight by radio from satellites.
  \ Receivers on the ground with a fixed position can also be used to calculate the
  precise time as a reference for scientific experiments.\",\n\t\"license_title\":
